import React from "react";
import logo from "./clear-sky.jpg";
const Header = () => {
    return (
        <>
        <div className="header">
            <img src={logo} alt="logo" width='70' height='50'/>
        </div>
        <h1>helllo header</h1>
        </>
    );
};
export default Header;
